            let listUsers = await axios.get("https://api.github.com/users")
            console.log(listUsers)
        }catch (error){
        console.error(error)
        }
        }
        useEffect(() => {setUsers(getUsers())
             }, [])
    return (
        <div>
            <h1>List Of Users</h1>
            <hr/>
            <div className="row">
            <div className="col-md-3">
            </div>
            </div>
            </div>
    )
}

